# KiriKiri .XP3 archive extraction tool
#
#   Extracts an .XP3 archive to a directory of files, including any
# subdirectory structure.  Does aggressive error-checking, so some
# assertions may have to be disabled with nonstandard XP3 files.
#
#   Optionally handles Fate Stay Night encryption.
#
# originally made by insani (supporting fate encryption)
#
# more encryption methods added by jpnoob in 2022
#
# warning: in games with srp/tpm protection, startup.tjs might be corrupted
# after decrypting. taking a non-corrupt file from another game seems to work
# (after all, it just calls another script file and maybe does protection
# stuff that can be removed)

