def chihiro_execute(hash,seed):
  # look up array-something[seed*16], get next function to call
  chihiro_func[seed]()
  assert 1==2

def chihiro_runxcode(hash):
  seed=hash&0x7f
  hash>>=7
  return [chihiro_execute(hash,seed),chihiro_execute(~hash,seed)]
  
def chihiro_findkey(hash):
  chihiro_runxcode(hash)
  chihiro_runxcode(hash^(hash>>16))
  # todo there's a bit more i guess
  assert 1==2

