      outfile.seek(0)
      data = array('B',outfile.read())
      for i in xrange(len(data)) :
         data[i] ^= 0x0052
      if len(data)>30 :
         data[30] ^= 0x0001
      if len(data)>55355 :
         data[55355] ^= 0x0020
      outfile.seek(0)
      outfile.write(data.tostring())
